  01> WILLIAMS, Juliet Elizabeth
  b• 24.08.1978
  Juliet b. at Dunedin. She attended Fendalton Primary School, Rangi Ruru Girls' School and
  Rudolf Steiner School in Christchurch, and Victoria and Canterbury Universities. She has acted
  since she was small and aims to study at a drama school, as she pursues a career on the stage
  and in film,
  03> WILLIAMS, Nicholas Martyn m on 05.12.1970 to RHODES, Victoria Patricia
  Mary
  b 18.08.1949
  b 12.01.1945
  Nicholas b. at Dunedin and m. at Timaru. Victoria, d/o Guy Rhodes and
  Patricia Ritchie, b, at Timaru. Address: 30 Harakeke Street, Christchurch
  Nicholas was educated at Christ's College (1963-66). On leaving school he
  joined Shell Oil (NZ) Ltd in Christchurch and resigned seven years later
  as a sales representative. After 24 years with the Mount Cook Group,
  first as a Travel Manager, then Reservations Controller, Controller of Reservations Services and
  staff trainer, he left to join the New Zealand School of Travel and Tourism as student tutor, based
  in Christchurch. Nicholas paints water colours and enjoys interesting cars.
  Victoria attended Craighead Diocesan Girls' School in Timaru then trained in Dunedin as a Karitane
  nurse. She now works at the Canterbury University Bookshop. Victoria is a garden lover and enjoys
  meeting people.
  01> WILLIAMS, Penelope Mary
  b 07.11.1973
  Penelope b. at Wellington. She was educated at St Margaret's College, Christchurch and has now
  completed a Bachelor of Laws degree at Canterbury University.
  02> WILLIAMS, Martyn Robert Henry
  b 28.03.1976
  Martyn b. at Timaru. He was educated at Christ's College, Christchurch, then attended
  Christchurch Polytechnic to complete a Visual Communications and Design course. He is now in
  California with FAI Home Security selling home security systems.
  02>' WILLIAMS, Harold
  b 27.10.1874 d 26.07.1875
  Harold b. and d, at Auckland.
  03> WILLIAMS, Claud Herbert m on 17.12.1920 to EGERTON, Dorothy Lesley
  b 18.02.1876 d 05.08.1970
  b 25.03.1898 d 18.11.1983
  Claud b. at Auckland, Lesley, d/o C W Egerton (professor at Auckland University).
  Claud was educated at Otago Boys' High School and subsequently gained farming
  experience with J N Williams on "Edenham" then managed "Te Apiti" for his uncle
  Joe. He acquired "Coventry" station and moved to Gisborne about 1906 or 1907.
  At the commencement of WW1 he chose to enlist in the British Army as a means of
